import React from 'react';
import EducationSaga from '.components/ExperienceSaga';

function Experience() {
    return (
        <div id="experience" className='section'>
            {sagas.map((saga, index) => (
                <ExperienceSaga key={index} {...saga} />
            ))}
        </div>
    );
}

export default Experience;
